import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./App.css";
import Chan from "./components/chan";
import JoinPage from "./components/JoinPage/joinpage";
import LoginPage from "./components/LoginPage/loginpage";
import MapPage from "./components/MapPage/mappage";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<LoginPage></LoginPage>}></Route>
          <Route path="/join" exact element={<JoinPage></JoinPage>}></Route>
          <Route path="/map" exact element={<MapPage></MapPage>}></Route>
          <Route path="/chan" exact element={<Chan></Chan>}></Route>
          <Route
            path="/users/:id"
            render={({ match }) => <User id={match.params.id} />}
          />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
